import React from "react";
import "./style.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faMoneyBillAlt,
  faHourglassEnd,
  faUser,
  faHandshake,
  faPuzzlePiece,
  faUserTimes,
} from "@fortawesome/free-solid-svg-icons";
function Component_NgangXanh() {
  return (
    <div>
      <div className="box">
        <div className="icon-hover">
        <i class="fas fa-hourglass-end"></i>

{/* <FontAwesomeIcon icon={faHourglassEnd} size="3x" color="#007c7e" /> */}
        </div>
      </div>
    </div>
  );
}

export default Component_NgangXanh;
